import React, {useState, useEffect} from "react";
import { Link } from "react-router-dom";

import useDocumentTitle from "../useDocumentTitle";

import "./pages.css";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faBackwardStep, faCaretLeft, faCaretRight, faForwardStep, faHeart, faMoon, faPause, faPlay, faScaleBalanced, faSun, faUser } from "@fortawesome/free-solid-svg-icons";

function Pages(props) {
  const [page, setPage] = useState(1);
  const [mode, setMode] = useState(0);

  useDocumentTitle(`${props.title}`);

  return (
    <div className="container">
      {/* <div className="wave">
        <div id="wave-1" ></div>
        <div id="wave-2" ></div>
        <div id="wave-3" ></div>
      </div> */}
      <div class="hero_area">
          <svg class="waves" xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink" viewBox="0 24 150 28" preserveAspectRatio="none" shape-rendering="auto">
              <defs>
                  <path id="gentle-wave" d="M-160 44c30 0 58-18 88-18s 58 18 88 18 58-18 88-18 58 18 88 18 v44h-352z" />
              </defs>
              <g class="parallax">
                  <use xlinkHref="#gentle-wave" x="48" y="0" fill="#CC3344" />
                  <use xlinkHref="#gentle-wave" x="48" y="3" fill="rgba(255,255,255,0.5)" />
                  <use xlinkHref="#gentle-wave" x="48" y="5" fill="rgba(255,255,255,0.3)" />
                  <use xlinkHref="#gentle-wave" x="48" y="7" fill="#fff" />
              </g>
          </svg>
      </div>
    </div>
  );
}

export default Pages;
